import React from 'react';
import { connect } from 'react-redux';

class Graph extends React.Component {
    constructor(props){
        super(props)
    }
    render(){
        return <div>
            grid
        </div>
    }
}

const styles = {}

function mapStateToProps(state){
    return {
        data: state.data,
        min: state.min,
        max: state.max
    }
}

export default connect(mapStateToProps,null)(Graph);
